import OrderItem from "./OrderItem"
import { useOutletContext } from "react-router-dom";



export default function ViewOrder() {
  const {salads, setSalads} = useOutletContext();
  return (

    <>
    <br />
      {salads.map((salad,i) =>
        <OrderItem salad={salad} i={i} key={salad.uuid}> </OrderItem>
      )}
    <br />
    </>
  )
}
